/// <summary>
/// Sets the current record of the table buffer assigned to the current instance of the 
/// DocPrintDestinationSettingsMap map from the specified print destination settings.
/// </summary>
/// <param name = "_pds">An instance of the SRSPrintDestinationSettings object with print destination settings</param>
public void setRecordFromPrintDestinationSettings(SRSPrintDestinationSettings _pds)
{
    DocPrintDestinationSettingsMap tmpPrintDestSettingsMap;

    if (_pds == null)
    {
        return;
    }

    // -------------------------------------------
    // Print destination
    // -------------------------------------------
    tmpPrintDestSettingsMap.PrintMediumType = _pds.printMediumType();

    // -------------------------------------------
    // Docentric generate DS
    // -------------------------------------------
    DocPrintDestSettingsGenerateDS docGenerateDSSettings = _pds.parmGenerateDSPrintDestSettings_DC();

    tmpPrintDestSettingsMap.DestDocGenerateDsXmlFilename = docGenerateDSSettings.parmXmlDataSourceFilename();
    tmpPrintDestSettingsMap.DestDocGenerateDsLanguage = docGenerateDSSettings.parmLanguageId();
    tmpPrintDestSettingsMap.DestDocGenerateDsPreviewLanguages = docGenerateDSSettings.parmPreviewLanguages();
    tmpPrintDestSettingsMap.DestDocGenerateDsDocentricEngine = docGenerateDSSettings.parmSelectedEngine();

    // -------------------------------------------
    // Docentric options
    // -------------------------------------------
    DocSrsPrintReportSettings docSrsPrintReportSettings = _pds.parmSrsPrintReportSettings_DC();

    tmpPrintDestSettingsMap.DestDocSaveInPrintArchive = docSrsPrintReportSettings.parmSaveToArchive();
    tmpPrintDestSettingsMap.DestDocSaveToArchiveNote = docSrsPrintReportSettings.parmSaveToArchiveNote();
    tmpPrintDestSettingsMap.DestDocSaveToArchiveDocuType = docSrsPrintReportSettings.parmSaveToArchiveDocuTypeId();
    tmpPrintDestSettingsMap.DestDocSaveProformaToArchive = docSrsPrintReportSettings.parmSaveProformaToArchive();
    tmpPrintDestSettingsMap.DestDocPdfAConformanceLevel = docSrsPrintReportSettings.parmPdfAConformanceLevel();
    tmpPrintDestSettingsMap.DestDocPreviewBeforePrint = docSrsPrintReportSettings.parmPreviewBeforePrint();

    // -------------------------------------------
    // Template
    // -------------------------------------------
    tmpPrintDestSettingsMap.DestDocTemplateId = docSrsPrintReportSettings.parmTemplateId();
    if (!tmpPrintDestSettingsMap.DestDocTemplateId)
    {
        tmpPrintDestSettingsMap.DestDocTemplateId = DocConstant::DefaultTemplatePlaceholder;
    }

    // -------------------------------------------
    // Docentric printer
    // -------------------------------------------
    DocPrintDestSettingsPrinter docPrinterSettings = _pds.parmPrinterPrintDestSettings_DC();

    tmpPrintDestSettingsMap.DestDocPrinterName = docPrinterSettings.parmSelectedPrinterName();
    tmpPrintDestSettingsMap.DestDocPrinterOrientation = docPrinterSettings.parmOrientation();
    tmpPrintDestSettingsMap.DestDocPrinterDuplexPrinting = docPrinterSettings.parmDuplexPrinting();
    tmpPrintDestSettingsMap.DestDocPrinterCollated = docPrinterSettings.parmCollated();
    tmpPrintDestSettingsMap.DestDocPrinterNumberOfCopies = docPrinterSettings.parmNumberOfCopies();
    tmpPrintDestSettingsMap.DestDocPrinterPrintFromPage = docPrinterSettings.parmPrintFromPage();
    tmpPrintDestSettingsMap.DestDocPrinterPrintToPage = docPrinterSettings.parmPrintToPage();
    tmpPrintDestSettingsMap.DestDocPrinterPrintAllPages = docPrinterSettings.parmPrintAllPages();
    tmpPrintDestSettingsMap.DestDocPrinterPrintAsPdf = docPrinterSettings.parmPrintAsPdf();
    tmpPrintDestSettingsMap.DestDocPrinterPrintAsPdfFilename = docPrinterSettings.parmPrintAsPdfFilename();

    // -------------------------------------------
    // Docentric file
    // -------------------------------------------
    DocPrintDestSettingsFile docFileSettings = _pds.parmFilePrintDestSettings_DC();

    tmpPrintDestSettingsMap.DestDocFileName = docFileSettings.parmOutputFilename();
    tmpPrintDestSettingsMap.DestDocFileFormat = docFileSettings.parmOutputFileFormat();
    tmpPrintDestSettingsMap.DestDocFileFormatSrs = docFileSettings.parmOutputFileFormatSrs();
    tmpPrintDestSettingsMap.DestDocFileDownloadOutputFile = docFileSettings.parmSendOutputFileToUser();

    tmpPrintDestSettingsMap.DestDocFileUseDocIdInFilename = docFileSettings.parmUseDocIdInFilename();
    tmpPrintDestSettingsMap.DestDocFileUseTimestampAsSuffix = docFileSettings.parmUseTimestampAsSuffix();
    tmpPrintDestSettingsMap.DestDocFileUseGuidAsSuffix = docFileSettings.parmUseGuidAsSuffix();

    tmpPrintDestSettingsMap.DestDocFileSaveToAzureBlob = docFileSettings.parmSaveToAzureBlobStorage();
    tmpPrintDestSettingsMap.DestDocFileAzureBlobStorageAccountId = docFileSettings.parmAzureBsAccountId();
    tmpPrintDestSettingsMap.DestDocFileAzureBlobContainer = docFileSettings.parmAzureBsContainerName();
    tmpPrintDestSettingsMap.DestDocFileAzureBlobPath = docFileSettings.parmAzureBsBlobPath();
    tmpPrintDestSettingsMap.DestDocFileAzureBlobOverrideFileIfExists = docFileSettings.parmAzureBsOverrideFileIfExists();

    tmpPrintDestSettingsMap.DestDocFileSaveToAzureFiles = docFileSettings.parmSaveToAzureFiles();
    tmpPrintDestSettingsMap.DestDocFileAzureFilesAccountId = docFileSettings.parmAzureFilesAccountId();
    tmpPrintDestSettingsMap.DestDocFileAzureFilesFileShare = docFileSettings.parmAzureFilesFileShareName();
    tmpPrintDestSettingsMap.DestDocFileAzureFilesFolderPath = docFileSettings.parmAzureFilesDirectoryPath();
    tmpPrintDestSettingsMap.DestDocFileAzureFilesOverrideFileIfExists = docFileSettings.parmAzureFilesOverrideFileIfExists();
    tmpPrintDestSettingsMap.DestDocFileAzureFilesCreateNonExistingFileShare = docFileSettings.parmAzureFilesCreateNonExistingFileShare();
    tmpPrintDestSettingsMap.DestDocFileAzureFilesCreateNonExistingFolders = docFileSettings.parmAzureFilesCreateNonExistingFolders();

    tmpPrintDestSettingsMap.DestDocFileSaveToSharePoint = docFileSettings.parmSaveToSharePoint();
    tmpPrintDestSettingsMap.DestDocFileSharePointSiteUrl = docFileSettings.parmSharePointSiteUrl();
    tmpPrintDestSettingsMap.DestDocFileSharePointFolderPath = docFileSettings.parmSharePointFolderPath();
    tmpPrintDestSettingsMap.DestDocFileSharePointOverrideFileIfExists = docFileSettings.parmSharePointOverrideFileIfExists();
    tmpPrintDestSettingsMap.DestDocFileSharePointCreateNonExistingFolders = docFileSettings.parmSharePointCreateNonExistingFolders();

    tmpPrintDestSettingsMap.DestDocFileSaveToAttachments = docFileSettings.parmSaveToAttachments();
    tmpPrintDestSettingsMap.DestDocFileAttachmentsDocuType = docFileSettings.parmSaveToAttachmentsDocuTypeId();
    tmpPrintDestSettingsMap.DestDocFileAttachmentsRecordType = docFileSettings.parmSaveToAttachmentsRecordType();
    tmpPrintDestSettingsMap.DestDocFileAttachmentsOverridingMode = docFileSettings.parmSaveToAttachmentsOverridingMode();
    tmpPrintDestSettingsMap.DestDocFileAttachmentsDocumentRestriction = docFileSettings.parmSaveToAttachmentsDocumentRestriction();
    tmpPrintDestSettingsMap.DestDocFileAttachmentsCategoryId = docFileSettings.parmSaveToAttachmentsCategory();
    tmpPrintDestSettingsMap.DestDocFileAttachmentsTags = docFileSettings.parmSaveToAttachmentsTags();
    tmpPrintDestSettingsMap.DestDocFileAttachmentsLanguageMode = docFileSettings.parmSaveToAttachmentsLanguageMode();
    tmpPrintDestSettingsMap.DestDocFileAttachmentsActiveFrom = docFileSettings.parmSaveToAttachmentsActiveFrom();
    tmpPrintDestSettingsMap.DestDocFileAttachmentsActiveTo = docFileSettings.parmSaveToAttachmentsActiveTo();

    tmpPrintDestSettingsMap.DestDocFileSaveToFileSystem = docFileSettings.parmSaveToFileSystem();
    tmpPrintDestSettingsMap.DestDocFileFileSystemSharedFolder = docFileSettings.parmFileSystemFilePath();
    tmpPrintDestSettingsMap.DestDocFileFileSystemOverrideFileIfExists = docFileSettings.parmFileSystemOverrideFileIfExists();

    // -------------------------------------------
    // Docentric email
    // -------------------------------------------
    DocPrintDestSettingsEmail docEmailSettings = _pds.parmEmailPrintDestSettings_DC();

    tmpPrintDestSettingsMap.DestDocEmailTo = docEmailSettings.parmEmailTo();
    tmpPrintDestSettingsMap.DestDocEmailSubject = docEmailSettings.parmEmailSubject();
    tmpPrintDestSettingsMap.DestDocEmailOpenEmailBeforeSending = docEmailSettings.parmOpenEmailBeforeSending();

    tmpPrintDestSettingsMap.DestDocEmailAttachmentName = docEmailSettings.parmEmailAttachmentName();
    tmpPrintDestSettingsMap.DestDocEmailAttachmentFileFormat = docEmailSettings.parmEmailAttachmentFileFormat();
    tmpPrintDestSettingsMap.DestDocEmailAttachmentFileFormatSrs = docEmailSettings.parmEmailAttachmentFileFormatSrs();

    tmpPrintDestSettingsMap.DestDocEmailCc = docEmailSettings.parmEmailCc();
    tmpPrintDestSettingsMap.DestDocEmailBcc = docEmailSettings.parmEmailBcc();
    tmpPrintDestSettingsMap.DestDocEmailFrom = docEmailSettings.parmEmailFrom();

    tmpPrintDestSettingsMap.DestDocEmailUseEmailTemplate = docEmailSettings.parmUseEmailTemplate();
    tmpPrintDestSettingsMap.DestDocEmailTemplateId = docEmailSettings.parmEmailTemplateId();
    tmpPrintDestSettingsMap.DestDocEmailBody = docEmailSettings.parmEmailBody();

    // -------------------------------------------
    // SSRS options
    // -------------------------------------------
    tmpPrintDestSettingsMap.DestSSRSSaveInPrintArchive = _pds.parmPrintToArchive();

    // -------------------------------------------
    // SSRS printer
    // -------------------------------------------
    tmpPrintDestSettingsMap.DestSSRSPrinterName = _pds.printerName();
    tmpPrintDestSettingsMap.DestSSRSPrinterOrientation = _pds.orientation();
    tmpPrintDestSettingsMap.DestSSRSPrinterOverridePageSettings = _pds.overridePageSettings();
    tmpPrintDestSettingsMap.DestSSRSPrinterDuplexPrinting = _pds.printOnBothSides();
    tmpPrintDestSettingsMap.DestSSRSPrinterCollated = _pds.collate();
    tmpPrintDestSettingsMap.DestSSRSPrinterNumberOfCopies = _pds.numberOfCopies();
    tmpPrintDestSettingsMap.DestSSRSPrinterPrintAllPages = _pds.printAllPages();
    tmpPrintDestSettingsMap.DestSSRSPrinterPrintFromPage = _pds.fromPage();
    tmpPrintDestSettingsMap.DestSSRSPrinterPrintToPage = _pds.toPage();

    // -------------------------------------------
    // SSRS file
    // -------------------------------------------
    tmpPrintDestSettingsMap.DestSSRSFileFormat = _pds.fileFormat();
    tmpPrintDestSettingsMap.DestSSRSFileName = _pds.fileName();

    // -------------------------------------------
    // SSRS email
    // -------------------------------------------
    tmpPrintDestSettingsMap.DestSSRSEmailTo = _pds.emailTo();
    tmpPrintDestSettingsMap.DestSSRSEmailCc = _pds.emailCc();
    tmpPrintDestSettingsMap.DestSSRSEmailSubject = _pds.emailSubject();
    tmpPrintDestSettingsMap.DestSSRSEmailAttachmentFileFormat = _pds.emailAttachmentFileFormat();


    // Copy data from the temporary map instance without an assigned table buffer to the current map instance
    // with an assigned table buffer. Fields that are not mapped in the current map instance are skipped.
    this.data(tmpPrintDestSettingsMap);
}

/// <summary>
/// Gets the print destination settings from the current record from the table buffer assigned
/// to the current instance of the DocPrintDestinationSettingsMap map.
/// </summary>
/// <returns>An instance of the SRSPrintDestinationSettings object</returns>
public SRSPrintDestinationSettings getPrintDestinationSettingsFromRecord()
{
    DocPrintDestinationSettingsMap tmpPrintDestSettingsMap;

    // Copy data from the current map instance with an assigned table buffer to the new temporary map instance
    // without an assigned table buffer. Fields that are not mapped in the current map instance are skipped.
    tmpPrintDestSettingsMap.data(this);

    // Create a new instance of the SRSPrintDestinationSettings object
    SRSPrintDestinationSettings pds = new SRSPrintDestinationSettings();

    // -------------------------------------------
    // Print destination
    // -------------------------------------------
    pds.printMediumType(tmpPrintDestSettingsMap.PrintMediumType);

    // -------------------------------------------
    // Options
    // -------------------------------------------
    pds.parmSrsPrintReportSettings_DC().parmSaveToArchive(tmpPrintDestSettingsMap.DestDocSaveInPrintArchive);
    pds.parmSrsPrintReportSettings_DC().parmSaveToArchiveNote(tmpPrintDestSettingsMap.DestDocSaveToArchiveNote);
    pds.parmSrsPrintReportSettings_DC().parmSaveToArchiveDocuTypeId(tmpPrintDestSettingsMap.DestDocSaveToArchiveDocuType);
    pds.parmSrsPrintReportSettings_DC().parmSaveProformaToArchive(tmpPrintDestSettingsMap.DestDocSaveProformaToArchive);
    pds.parmSrsPrintReportSettings_DC().parmPdfAConformanceLevel(tmpPrintDestSettingsMap.DestDocPdfAConformanceLevel);
    pds.parmSrsPrintReportSettings_DC().parmPreviewBeforePrint(tmpPrintDestSettingsMap.DestDocPreviewBeforePrint);

    // -------------------------------------------
    // Template
    // -------------------------------------------
    pds.parmSrsPrintReportSettings_DC().parmTemplateId(tmpPrintDestSettingsMap.DestDocTemplateId == DocConstant::DefaultTemplatePlaceholder ? '' : tmpPrintDestSettingsMap.DestDocTemplateId);

    // -------------------------------------------
    // Docentric printer
    // -------------------------------------------
    DocPrintDestSettingsPrinter docPrinterSettings = new DocPrintDestSettingsPrinter();

    docPrinterSettings.parmSelectedPrinterName(tmpPrintDestSettingsMap.DestDocPrinterName);
    docPrinterSettings.parmOrientation(tmpPrintDestSettingsMap.DestDocPrinterOrientation);
    docPrinterSettings.parmDuplexPrinting(tmpPrintDestSettingsMap.DestDocPrinterDuplexPrinting);
    docPrinterSettings.parmCollated(tmpPrintDestSettingsMap.DestDocPrinterCollated);
    docPrinterSettings.parmNumberOfCopies(tmpPrintDestSettingsMap.DestDocPrinterNumberOfCopies);
    docPrinterSettings.parmPrintFromPage(tmpPrintDestSettingsMap.DestDocPrinterPrintFromPage);
    docPrinterSettings.parmPrintToPage(tmpPrintDestSettingsMap.DestDocPrinterPrintToPage);
    docPrinterSettings.parmPrintAllPages(tmpPrintDestSettingsMap.DestDocPrinterPrintAllPages);
    docPrinterSettings.parmPrintAsPdf(tmpPrintDestSettingsMap.DestDocPrinterPrintAsPdf);
    docPrinterSettings.parmPrintAsPdfFilename(tmpPrintDestSettingsMap.DestDocPrinterPrintAsPdfFilename);

    pds.parmPrinterPrintDestSettings_DC(docPrinterSettings);

    // -------------------------------------------
    // Docentric file
    // -------------------------------------------
    DocPrintDestSettingsFile docFileSettings = new DocPrintDestSettingsFile();

    docFileSettings.parmOutputFilename(tmpPrintDestSettingsMap.DestDocFileName);
    docFileSettings.parmOutputFileFormat(tmpPrintDestSettingsMap.DestDocFileFormat);
    docFileSettings.parmOutputFileFormatSrs(tmpPrintDestSettingsMap.DestDocFileFormatSrs);
    docFileSettings.parmUseSsrsBuiltInDesign(tmpPrintDestSettingsMap.DestDocTemplateId == DocConstant::BuiltInSsrsDesignPlaceholder);
    docFileSettings.parmSendOutputFileToUser(tmpPrintDestSettingsMap.DestDocFileDownloadOutputFile);

    docFileSettings.parmUseDocIdInFilename(tmpPrintDestSettingsMap.DestDocFileUseDocIdInFilename);
    docFileSettings.parmUseTimestampAsSuffix(tmpPrintDestSettingsMap.DestDocFileUseTimestampAsSuffix);
    docFileSettings.parmUseGuidAsSuffix(tmpPrintDestSettingsMap.DestDocFileUseGuidAsSuffix);

    docFileSettings.parmSaveToAzureBlobStorage(tmpPrintDestSettingsMap.DestDocFileSaveToAzureBlob);
    docFileSettings.parmAzureBsAccountId(tmpPrintDestSettingsMap.DestDocFileAzureBlobStorageAccountId);
    docFileSettings.parmAzureBsContainerName(tmpPrintDestSettingsMap.DestDocFileAzureBlobContainer);
    docFileSettings.parmAzureBsBlobPath(tmpPrintDestSettingsMap.DestDocFileAzureBlobPath);
    docFileSettings.parmAzureBsOverrideFileIfExists(tmpPrintDestSettingsMap.DestDocFileAzureBlobOverrideFileIfExists);

    docFileSettings.parmSaveToAzureFiles(tmpPrintDestSettingsMap.DestDocFileSaveToAzureFiles);
    docFileSettings.parmAzureFilesAccountId(tmpPrintDestSettingsMap.DestDocFileAzureFilesAccountId);
    docFileSettings.parmAzureFilesFileShareName(tmpPrintDestSettingsMap.DestDocFileAzureFilesFileShare);
    docFileSettings.parmAzureFilesDirectoryPath(tmpPrintDestSettingsMap.DestDocFileAzureFilesFolderPath);
    docFileSettings.parmAzureFilesOverrideFileIfExists(tmpPrintDestSettingsMap.DestDocFileAzureFilesOverrideFileIfExists);
    docFileSettings.parmAzureFilesCreateNonExistingFileShare(tmpPrintDestSettingsMap.DestDocFileAzureFilesCreateNonExistingFileShare);
    docFileSettings.parmAzureFilesCreateNonExistingFolders(tmpPrintDestSettingsMap.DestDocFileAzureFilesCreateNonExistingFolders);

    docFileSettings.parmSaveToSharePoint(tmpPrintDestSettingsMap.DestDocFileSaveToSharePoint);
    docFileSettings.parmSharePointSiteUrl(tmpPrintDestSettingsMap.DestDocFileSharePointSiteUrl);
    docFileSettings.parmSharePointFolderPath(tmpPrintDestSettingsMap.DestDocFileSharePointFolderPath);
    docFileSettings.parmSharePointOverrideFileIfExists(tmpPrintDestSettingsMap.DestDocFileSharePointOverrideFileIfExists);
    docFileSettings.parmSharePointCreateNonExistingFolders(tmpPrintDestSettingsMap.DestDocFileSharePointCreateNonExistingFolders);

    docFileSettings.parmSaveToAttachments(tmpPrintDestSettingsMap.DestDocFileSaveToAttachments);
    docFileSettings.parmSaveToAttachmentsDocuTypeId(tmpPrintDestSettingsMap.DestDocFileAttachmentsDocuType);
    docFileSettings.parmSaveToAttachmentsRecordType(tmpPrintDestSettingsMap.DestDocFileAttachmentsRecordType);
    docFileSettings.parmSaveToAttachmentsOverridingMode(tmpPrintDestSettingsMap.DestDocFileAttachmentsOverridingMode);
    docFileSettings.parmSaveToAttachmentsDocumentRestriction(tmpPrintDestSettingsMap.DestDocFileAttachmentsDocumentRestriction);
    docFileSettings.parmSaveToAttachmentsCategory(tmpPrintDestSettingsMap.DestDocFileAttachmentsCategoryId);
    docFileSettings.parmSaveToAttachmentsTags(tmpPrintDestSettingsMap.DestDocFileAttachmentsTags);
    docFileSettings.parmSaveToAttachmentsLanguageMode(tmpPrintDestSettingsMap.DestDocFileAttachmentsLanguageMode);
    docFileSettings.parmSaveToAttachmentsActiveFrom(tmpPrintDestSettingsMap.DestDocFileAttachmentsActiveFrom);
    docFileSettings.parmSaveToAttachmentsActiveTo(tmpPrintDestSettingsMap.DestDocFileAttachmentsActiveTo);

    docFileSettings.parmSaveToFileSystem(tmpPrintDestSettingsMap.DestDocFileSaveToFileSystem);
    docFileSettings.parmFileSystemFilePath(tmpPrintDestSettingsMap.DestDocFileFileSystemSharedFolder);
    docFileSettings.parmFileSystemOverrideFileIfExists(tmpPrintDestSettingsMap.DestDocFileFileSystemOverrideFileIfExists);

    pds.parmFilePrintDestSettings_DC(docFileSettings);

    // -------------------------------------------
    // Docentric email
    // -------------------------------------------
    DocPrintDestSettingsEmail docEmailSettings = new DocPrintDestSettingsEmail();

    docEmailSettings.parmEmailTo(tmpPrintDestSettingsMap.DestDocEmailTo);
    docEmailSettings.parmEmailSubject(tmpPrintDestSettingsMap.DestDocEmailSubject);
    docEmailSettings.parmOpenEmailBeforeSending(tmpPrintDestSettingsMap.DestDocEmailOpenEmailBeforeSending);

    docEmailSettings.parmEmailAttachmentName(tmpPrintDestSettingsMap.DestDocEmailAttachmentName);
    docEmailSettings.parmEmailAttachmentFileFormat(tmpPrintDestSettingsMap.DestDocEmailAttachmentFileFormat);
    docEmailSettings.parmEmailAttachmentFileFormatSrs(tmpPrintDestSettingsMap.DestDocEmailAttachmentFileFormatSrs);
    docEmailSettings.parmEmailAttachmentUseSsrsBuiltInDesign(tmpPrintDestSettingsMap.DestDocTemplateId == DocConstant::BuiltInSsrsDesignPlaceholder);

    docEmailSettings.parmEmailCc(tmpPrintDestSettingsMap.DestDocEmailCc);
    docEmailSettings.parmEmailBcc(tmpPrintDestSettingsMap.DestDocEmailBcc);
    docEmailSettings.parmEmailFrom(tmpPrintDestSettingsMap.DestDocEmailFrom);

    docEmailSettings.parmUseEmailTemplate(tmpPrintDestSettingsMap.DestDocEmailUseEmailTemplate);
    docEmailSettings.parmEmailTemplateId(tmpPrintDestSettingsMap.DestDocEmailTemplateId);
    docEmailSettings.parmEmailBody(tmpPrintDestSettingsMap.DestDocEmailBody);

    pds.parmEmailPrintDestSettings_DC(docEmailSettings);

    // -------------------------------------------
    // SSRS options
    // -------------------------------------------
    pds.parmPrintToArchive(tmpPrintDestSettingsMap.DestSSRSSaveInPrintArchive);

    // -------------------------------------------
    // SSRS printer
    // -------------------------------------------
    pds.printerName(tmpPrintDestSettingsMap.DestSSRSPrinterName);
    pds.orientation(tmpPrintDestSettingsMap.DestSSRSPrinterOrientation);
    pds.overridePageSettings(tmpPrintDestSettingsMap.DestSSRSPrinterOverridePageSettings);
    pds.printOnBothSides(tmpPrintDestSettingsMap.DestSSRSPrinterDuplexPrinting);
    pds.collate(tmpPrintDestSettingsMap.DestSSRSPrinterCollated);
    pds.numberOfCopies(tmpPrintDestSettingsMap.DestSSRSPrinterNumberOfCopies);
    pds.printAllPages(tmpPrintDestSettingsMap.DestSSRSPrinterPrintAllPages);
    pds.fromPage(tmpPrintDestSettingsMap.DestSSRSPrinterPrintFromPage);
    pds.toPage(tmpPrintDestSettingsMap.DestSSRSPrinterPrintToPage);

    // -------------------------------------------
    // SSRS file
    // -------------------------------------------
    pds.fileFormat(tmpPrintDestSettingsMap.DestSSRSFileFormat);
    pds.fileName(tmpPrintDestSettingsMap.DestSSRSFileName);

    // -------------------------------------------
    // SSRS email
    // -------------------------------------------
    pds.emailTo(tmpPrintDestSettingsMap.DestSSRSEmailTo);
    pds.emailCc(tmpPrintDestSettingsMap.DestSSRSEmailCc);
    pds.emailSubject(tmpPrintDestSettingsMap.DestSSRSEmailSubject);
    pds.emailAttachmentFileFormat(tmpPrintDestSettingsMap.DestSSRSEmailAttachmentFileFormat);

    return pds;
}
